// SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;

contract BudgetWallet {

address owner;
// address Factory = '';

struct BudgetItem {
    uint _index;
    string _title;
    uint256 _percent;
    uint256 _totalSpend;
}



event WalletCreated(address _owner);

BudgetItem[] Budgets;
mapping(address => BudgetItem[]) TokenBudgets;


function Initialize(string[] memory _titles,uint256[] memory _percents,address _owner) public {
    // require(msg.sender == Factory,'FORBIDDEN');
    owner = _owner;
    BudgetItem memory cItem;
    for (uint256 index = 0; index < _titles.length; index++) {
        cItem._index = index;
        cItem._title = _titles[index];
        cItem._percent = _percents[index];
        cItem._totalSpend = 0;
        Budgets.push(cItem);
    }
    emit WalletCreated(_owner);
}


function getBudget() public view returns(BudgetItem[] memory _budgets){
    return Budgets;
}

function getTokenBudget(address _token) public view returns(BudgetItem[] memory _budgets) {
    return TokenBudgets[_token];
}






}
